import './App.css';
import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Alarm from "./pages/Alarm";
import Timer from "./pages/timer";
import Weather from "./pages/weather";
import CheckList from './pages/list';


function Nav() {
  return (
    <header>
      <nav id="nav">
        <Link to="/">Home</Link>
        <Link to="/Alarm">Alarm</Link>
        <Link to="/timer">Timer</Link>
        <Link to="/list">CheckList</Link>
        <Link to="/weather">Weather</Link>
      </nav>
    </header>
  )
}

function Main() {
  return (
    <>
      <Nav></Nav>
      <article>
        <h1>WELCOME !</h1>
        <div>
          <Link to="/Alarm" className="nav alarm">
            <h2>Alarm</h2>
            <p>시간과 간단한 코멘트를 기록하여 설정한 시간이 되면 알려주는 기능.</p>
          </Link>
          <Link to="/timer" className="nav timer">
            <h2>Timer</h2>
            <p></p>
          </Link>
          <Link to="/list" className="nav checklist">CheckList</Link>
          <Link to="/weather" className="nav weather">Weather</Link>
        </div>
      </article>
    </>
  )
}

function App() {

  return (
    <Routes>
      <Route path="/" element={<Main />}></Route>
      <Route path="/Alarm" element={<Alarm />}></Route>
      <Route path="/timer" element={<Timer />}></Route>
      <Route path="/list" element={<CheckList />}></Route>
      <Route path="/weather" element={<Weather />}></Route>
    </Routes>

  );
}


export default App;
